# Q_TO_AWAITING_UID Service

[]
SERVICE_NAME=Q_TO_AWAITING_UID

[Q_TO_AWAITING_UID]

# 服务切片数
GROUP_NUM=1

# 切片类型, 1:取模, 2:区间
