# 区间切片文件, 仅当切片类型为2时启用.
RANGE_TABLE=service_q2awaiting_uid_rangetable.cfg

[Q_TO_AWAITING_UID_GROUP_0]

# 节点数量
Q_TO_AWAITING_UID_NODE_NUM=1

# 节点地址
Q_TO_AWAITING_UID_HOST_0=127.0.0.1
Q_TO_AWAITING_UID_PORT_0=6379

